import React from "react";
import  ReactDOM  from "react-dom";
import Home from "./Home";
import TestDetail from "./TestDetail"
import GoodScore from "./GoodScore";
import GetAdmission from "./GetAdmission";
import Contact from './Contact';


import { BrowserRouter, Routes, Route } from 'react-router-dom';

import './index.css';

import Navbar from './Navbar';
import Footer from './Footer';
ReactDOM.render(
  <>
  <Navbar/>


    <Routes>
    <Route  path="/" element={<Home/>} />

    <Route exact path="/contact" element={<Contact/>} />

    <Route exact path="/Testdetail" element={<TestDetail/>} />

    <Route exact path="/GoodScore" element={<GoodScore/>} />

    <Route exact path="/Getadmission" element={<GetAdmission/>} />
    </Routes>





  <Footer/>
  </>,
  document.getElementById("root")
);
